import React, { Component } from "react";

class Wordtile extends Component {
    render() {
        const src = this.props.wordtile.showSource ? this.props.wordtile.source : ""
        const trn = this.props.wordtile.showTrans ? this.props.wordtile.trans : ""

        console.log("Inside the wordtile render func: ", src, " ", trn)

        return (
        <div>
            <div className="row">
            <div className="">
                <button className="custom-button" onClick={() => this.props.sourceClickHandler(this.props.wordtile.id)}>
                    {src}
                </button>
                <button className="custom-button" onClick={() => this.props.transClickHandler(this.props.wordtile.id)}>
                    {trn}
                </button>
            </div>
            </div>
        </div>
        );
    }
}

export default Wordtile;
